import axios from 'axios'




export function getCountries () {
    return axios.get("http://localhost:3001/countries/")
      .then((response) => {
        dispatch({
            type: GET_COUNTRIES,
            payload: response.data
        })
        })
      .catch((error) => console.log(error));
  }
